import React, { Component } from 'react';
import cloudinary from 'cloudinary'


class EditProduct extends Component {
    constructor(props) {
        super(props)
        this.upload = this.upload.bind(this);
    }

    upload() {
        console.log('clicked');
        cloudinary.config({
          cloud_name: 'cloudname',
          api_key: 'apikey',
          api_secret: 'secretkey'
        });
        cloudinary.uploader.upload(
          "https://www.google.com.pr/images/branding/googlelogo/2x/googlelogo_color_272x92dp.png",
          function(result) {
            console.log(result)
          }
        )
      }

    render() {
        return (
            <>
                <head>
                    <script src="https://widget.cloudinary.com/v2.0/global/all.js" type="text/javascript"></script>
                </head>
                <div>
                    <button id="upload_widget" class="cloudinary-button" onClick={this.openWidget}>Upload files</button>
                </div>
            </>
        );
    }
}

export default EditProduct;
